Late summer wouldn‚Äôt be the same without majestic Dahlia blooms. From sweet and small Pom Pom Dahlias to big and bold Dinner plate Dahlias, we love all things having to do with this fabulous flower. 

Dahlias are very easy to breed with over 5,000 cultivars in existence, and more varieties added each year. Native to Mexico and Central America, they were originally used mainly as a source of food, although the entire plant was used for differing needs. The tuber is the part that is consumed with flavors being a cross between carrot, celery and potato. Their phenomenal flowers were depicted in beautiful drawings by native civilizations. The Aztecs used Dahlias to treat epilepsy and the hollow stem was used for water pipes. The Spanish brought the tubers to Spain in the 1700‚Äôs. 

The common name used today, Dahlia, was named after a Swedish Botanist named Anders Dahl. The original name of the plant is "Chichipatl" (Toltecs) and "Acocotle" or "Cocoxochitl" (Aztecs). Translated the name refers to the hollow stem of the plant such as ‚Äúwater pipe flower‚Äù or ‚Äúhollow stem flower‚Äù.";}i:108;a:1:{s:14:"comments_count";i:1;}i:109;a:1:{s:11:"likes_count";i:7;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuttM5jyEQ";}i:111;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118719721_2644953539167731_7234996734037856700_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=sL2fxpCvK68AX_gVOIW&oh=4e11edccf222fcc7bf72ed6c9e56cfde&oe=5F7A8009";}i:112;a:1:{s:4:"type";s:5:"image";}i:113;a:1:{s:8:"owner_id";i:8403693541;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id";s:19:"2391049340149622050";}i:118;a:1:{s:10:"short_code";s:11:"CEutrTgDOUi";}i:119;a:1:{s:12:"created_time";i:1599255314;}i:120;a:1:{s:7:"caption";s:377:"Petto d'anatra, pain perdu e tartufo nero
